import React from 'react';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';

import FormControl from '@material-ui/core/FormControl';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormHelperText from '@material-ui/core/FormHelperText';

const useStyles = makeStyles(theme => ({
  root: {
    marginTop: 40,
    marginRight: theme.spacing(3)
  },
  itemTitle: {
    paddingBottom: 10,
    marginBottom: 10,
    borderBottom: '1px solid #e4e4e4'
  },
  lightText: {
    color: '#636363',
    float: 'right'
  },
  itemPrice: {
    fontWeight: 500
  }
}));

function ItemDescription() {
  const classes = useStyles();
  return (
    <Paper className={classes.root}>
      <Typography className={classes.itemTitle} variant="h5" component="h3">
        Naujas medvilninis džemperis, M dydis
      </Typography>
      <Grid container spacing={2}>
        <Grid item md={3}>
          <Typography className={classes.lightText} display="inline" component="p">
            Aprašymas:
          </Typography>
        </Grid>
        <Grid item md={9}>
          <Typography display="inline" component="p">
            Parduodu džemperį M dydžio, moteriškas. Atsiimti galite Vilniuje, su aukciono laimėtoju
            susisieksiu asmeniškai per el. paštą, susitarti dėl atsiėmimo. Į kitus miestus
            nesiunčiu.
          </Typography>
        </Grid>
      </Grid>
      <Grid container spacing={2}>
        <Grid item md={3}>
          <Typography className={classes.lightText} display="inline" component="p">
            Būklė:
          </Typography>
        </Grid>
        <Grid item md={9}>
          <Typography display="inline" component="p">
            Naujas
          </Typography>
        </Grid>
      </Grid>
      <Grid container spacing={2}>
        <Grid item md={3}>
          <Typography className={classes.lightText} display="inline" component="p">
            Liko laiko:
          </Typography>
        </Grid>
        <Grid item md={9}>
          <Typography display="inline" component="p">
            999 h
          </Typography>
        </Grid>
      </Grid>
      <Grid container spacing={2}>
        <Grid item md={3}>
          <Typography className={classes.lightText} display="inline" component="p">
            Dabartinė kaina:
          </Typography>
        </Grid>
        <Grid item md={9}>
          <Typography className={classes.itemPrice} display="inline" variant="h4" component="h4">
            9999.99 €
          </Typography>
        </Grid>
      </Grid>
      <Grid container spacing={2}>
        <Grid item md={3}></Grid>
        <Grid item md={9}>
          <FormControl className={clsx(classes.margin, classes.textField)} variant="outlined">
            <OutlinedInput
              id="outlined-adornment-weight"
              value={values.weight}
              onChange={handleChange('weight')}
              endAdornment={<InputAdornment position="end">Kg</InputAdornment>}
              aria-describedby="outlined-weight-helper-text"
              inputProps={{
                'aria-label': 'weight'
              }}
              labelWidth={0}
            />
            <FormHelperText id="outlined-weight-helper-text">Weight</FormHelperText>
          </FormControl>
        </Grid>
      </Grid>
    </Paper>
  );
}

export default ItemDescription;
